import React, { useState } from "react";
import { render } from "react-dom";
import Timeline from "react-visjs-timeline";
import moment from "moment";
import "./styles.css";

const options = {
  width: "100%",
  height: "90vh",
  showMajorLabels: true,
  showCurrentTime: true,
  zoomMin: 1000000,
  type: "range",
  orientation: "top",
  stack: true,
  editable: true,
};

const groups = [
  {
    id: 1,
    content: "AUDI",
    nestedGroups: [11, 12],
    items: ["The Audi"],
    showNested: false,
  },

  {
    id: 2,
    content: "BMW",
    items: ["Interviews"],
    nestedGroups: [13],
    showNested: false,
  },

  {
    id: 3,
    content: "APPLE",
    items: [" Roadmap"],
    nestedGroups: [14,15],
    showNested: false,
  },

  {
    id:11,
    content:"Audi Q8",
    items: [ ],
  },
  {
    id:12,
    content:"Audi R8",
    items: [ ],
  },
  {
    id:13,
    content:"BMW X1",
    items: [ ],
  },
  {
    id:14,
    content:"Juice",
    items: [ ],
  },
  {
    id:15,
    content:"Shake",
    items: [ ],
  },
];


showHideAllGroups = function(button) {
  if (button.dataset.value == "allGroups-hidden") {
      groups.forEach(function(group) {
          groups.update({
              id: group.id,
              visible: true,
              showNested: true
          });
      });
      button.dataset.value = "allGroups-visible";
  } else {
      groups.forEach(function(group) {
          if (group["id"] < groupIds.length) {
              groups.update({
                  id: group.id,
                  showNested: false
              });
          } else {
              groups.update({
                  id: group.id,
                  visible: false
              });
          }
      });
      button.dataset.value = "allGroups-hidden";
  }
};
const items = [];
groups.forEach((group) => {
  group.items.forEach((item) => {
    items.push({
      id: items.length,
      start: moment().startOf("day").add(items.length, "days"),
      end: moment()
        .startOf("day")                 
        .add(items.length + 5, "days"),
      content: item,
      group: group.id,
    });
  });
});

    /********* BASIC EXEMPLE DEMO BELOW ********
    * to hide or show all grous from once button
    */



const App = () => (
  <div className="timeline">

    <Timeline options={options} items={items} groups={groups} />

  </div>
);


render(<App />, document.getElementById("root"));
